css:
atom-text-editor,
:host {
  background-color: #262626;
  color: #D6AED6;
}
atom-text-editor .invisible-character,
:host .invisible-character,
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #D0D0D0;
}
atom-text-editor .gutter,
:host .gutter {
  background: #262626;
  color: #999999;
}
atom-text-editor .is-focused .cursor,
:host .is-focused .cursor {
  border-color: #e6e6e6;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #404040;
}
atom-text-editor .line-number.cursor-line,
:host .line-number.cursor-line,
atom-text-editor .atom-text-editor.is-focused .line.cursor-line,
:host .atom-text-editor.is-focused .line.cursor-line {
  background-color: #333333;
  font-weight: bold;
}
atom-text-editor .bracket-matcher .region,
:host .bracket-matcher .region {
  background-color: #666;
  opacity: 0.7;
}
atom-text-editor .comment,
:host .comment {
  color: #D0D0D0;
  font-style: italic;
}
atom-text-editor .invalid.deprecated,
:host .invalid.deprecated {
  text-decoration: underline;
  color: #D68686;
}
atom-text-editor .string,
:host .string {
  color: #D7AF87;
}
atom-text-editor .string .constant.character.escape,
:host .string .constant.character.escape {
  color: #D68686;
}
atom-text-editor .string.regexp,
:host .string.regexp {
  color: #D7AF87;
}
atom-text-editor .string.regexp .source.ruby.embedded,
:host .string.regexp .source.ruby.embedded,
atom-text-editor .string.regexp .string.regexp.arbitrary-repitition,
:host .string.regexp .string.regexp.arbitrary-repitition {
  color: #D68686;
}
atom-text-editor .constant,
:host .constant {
  color: #D7AF87;
}
atom-text-editor .variable,
:host .variable,
atom-text-editor .variable.parameter,
:host .variable.parameter,
atom-text-editor .variable.other,
:host .variable.other {
  color: #DBCF80;
}
atom-text-editor .entity,
:host .entity {
  color: #86AED6;
}
atom-text-editor .entity.other.inherited-class,
:host .entity.other.inherited-class {
  font-style: italic;
  color: #6ECFF6;
}
atom-text-editor .storage,
:host .storage {
  color: #AED686;
}
.keyword:not(.keyword.operator),
.keyword.operator.logical {
  color: #AED686;
}
.keyword {
  color: #AED686;
}
.support.type.exception {
  color: #D68686;
}
.entity.other.attribute-name {
  color: #D7AF87;
}
.support.constant {
  color: #D68686;
}
.support.type,
.support.class {
  color: #86AED6;
}
.support.other.variable {
  color: #D68686;
}
.invalid {
  color: #DDE6CF;
  background-color: #5F0047;
}
.comment {
  color: #D0D0D0;
}
.meta.function.section {
  background-color: #371D28;
}
.markup.deleted {
  color: #D68686;
}
.markup.inserted {
  color: #AED686;
}
.markup.changed {
  color: #86AED6;
}
.markdown-preview {
  overflow-x: auto;
}
